import React, { Component } from "react";

class User extends Component {
  constructor(props) {
    super(props);

    this.state = {
      username: ""
    };
  }

  onChangeUsername(e) {
    this.setState({
      username: e.target.value
    });
  }

  onSubmit(e){
    e.preventDefault();
    const user = {
        username: this.state.user
    } 

    console.log(user);
  }

  render() {
    return (
      <div>
        <div>
          <form>
            <div className="form-group">
              <label>Username:</label>
              <input type="text" onChange={this.onChangeUsername} className="form-conrol" />
            </div>
          </form>
        </div>
      </div>
    );
  }
}

export default User;
